    <Jumbotron bsClass={{
      'background-color' : "#CFD8DC"
    }}>
        <h1 className="text-center">{props.title}</h1>
        <p className="text-center">{props.text}</p>
        <p>
            {/* <Button bsStyle="primary">Learn more</Button> */}
        </p>
    </Jumbotron>
  );
}

